qMeasure.qDef:
Sum(
  Aggr(
    if(Sum({<SessionUsageMonthText={'$(=Date(today(),'MMM YYYY'))'}, SessionEntitlementConsumed={'analyzer_time'}>}SessionMinutesUsed)
        >Alt(Max({<OverviewAllotmentMonth={'$(=Date(today(),'MMM YYYY'))'}, OverviewEntitlementType={'analyzer_time'}>}OverviewUnits),0),
        Sum({<SessionUsageMonthText={'$(=Date(today(),'MMM YYYY'))'}, SessionEntitlementConsumed={'analyzer_time'}>}SessionMinutesUsed)
        -
        Alt(Max({<OverviewAllotmentMonth={'$(=Date(today(),'MMM YYYY'))'}, OverviewEntitlementType={'analyzer_time'}>}OverviewUnits),0),0),
        TenantID
  )
)
